const input = $input.first().json;
const order = input.body || input;
const items = (order.line_items || []).map(item => ({
  productId: item.product_id,
  name: item.name,
  sku: item.sku || 'N/A',
  quantity: item.quantity,
  price: parseFloat(item.price) || 0,
  total: parseFloat(item.total) || 0
}));
const shipping = order.shipping || {};
const billing = order.billing || {};
return [{ json: { orderId: order.id, orderNumber: order.number || 'ORD-' + Date.now(), items, customer: { email: billing.email, firstName: billing.first_name }, shipping: { city: shipping.city, country: shipping.country || 'US' }, total: parseFloat(order.total) || 0 } }];

